commits.content:
@import url("https://fonts.googleapis.com/css2?family=Inter:wght@400;600;700&display=swap");

:root {
    --white: hsl(0, 0%, 100%);
    --grey: hsl(0, 0%, 20%);
    --dark-grey: hsl(0, 0%, 12%);
    --off-black: hsl(0, 0%, 8%);
    --green: hsl(75, 94%, 57%);
}

*, *::after, *::before {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    font-family: "Inter", sans-serif;
    font-size: 14px;
    background-color: var(--off-black);
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: ;
}

.profile {
    background-color: var(--dark-grey);
    padding: 2rem;
    border-radius: 0.75rem;
    box-shadow: 5px 5px 5px rgba(0, 0, 0, 0.05);
    display: flex;
    flex-direction: column;
    align-items: center;
    margin: 7rem 2rem;
}

.profile__avatar {
    max-width: 35%;
    border-radius: 50%;
    margin-bottom: 1rem;
}

.profile__name {
    color: var(--white);
    text-align: center;
    margin-bottom: 1rem;
}

.profile__location {
    color: var(--green);
    text-align: center;
    margin-bottom: 2rem;
}

.profile__bio {
    color: var(--white);
    text-align: center;
    margin-bottom: 2rem;
}

.profile__social-media a {
    background-color: var(--grey);
    color: var(--white);
    width: 100%;
    font-weight: bold;
    padding: 10px 30px;
    text-align: center;
    text-decoration: none;
    display: block;
    margin-bottom: 1rem;
    border-radius: 0.625rem;
}

.profile__social-media a:hover {
    background-color: var(--green);
    color: var(--off-black);
}


.attribution {
    font-size: 11px;
    text-align: center;
}

.attribution a {
    color: hsl(228, 45%, 44%);
}
